import React, { Component } from 'react'
import Region from '../components/Region'

import { Segment } from 'semantic-ui-react';

const OpeningPage = (props) => {
	return (
		<Segment id='open-page'>
			<button>Enter</button>
		</Segment>
	)
}

export default OpeningPage;
